import React from 'react';
import '../styles/Sidebar.css';

const Sidebar = () => (
  <div className="sidebar">
    <h3>Categories</h3>
    <ul>
      <li>Men</li>
      <li>Women</li>
      <li>Kids</li>
    </ul>
  </div>
);

export default Sidebar;
